import './style.css';
import React from 'react';
import angry from './angry.jpg';
import figma from './figma.png';
import uniqlo from "./uniqlo.png";
import one from "./uniqloPics/1.jpg"
import two from "./uniqloPics/2.jpg"

function UniqloPage() {
  return (
    <div className="project">
      <h2 className="project-title">UNIQLO App Redesign</h2>
      <div className="project-created">Feburary 2021</div>
      <img className="logo-resize" src={figma} alt="figma logo"/>
      <br />
      <img className="project-pic-resize" src={uniqlo} alt="uniqlo" />
      <br />
      <div className="info">
        I worked as a retail assistant at UNIQLO for a couple years and I was able to          observe how consumers used the app and the difficulties they experienced
          while using their shopping and membership services.            Using these observations, I have redesigned the app.
      </div>


      <div className="project-grid-container">
          <div className="project-container">
            <div className="project-grid-item">
              // <img className="resize" src={one} alt="uniqlo" />
            </div>
          </div>
          <div className="project-container">
            <div className="project-grid-item">
              // <img className="resize" src={two} alt="nutri" />
            </div>
          </div>
      </div>
    </div>
  );
}

export default UniqloPage;
